import axios from 'axios';
const api = axios.create({
  withCredentials: true,
  baseURL: "http://127.0.0.1:3001/api/auth/"
});
export const registerUser = (login, full_name, email, password) => api.post("/register/", {
  login: login,
  full_name: full_name,
  email: email,
  password: password
});
export const loginn = (email, login, password) => axios.post("http://127.0.0.1:3001/api/auth/login/", {
  email: email,
  login: login,
  password: password
});
